figure()
surf(x2, z2, data_i(:,:,1,1) - data_ci(:,:,1,1));
axis 'tight'
title('Matlab - C++')

%% Plot difference Matlab - C++ interpolated along edges
figure()
hold on;
plot(data_i(:,1,1,1) - data_ci(:,1,1,1));
