plot(data_i(1,:,1,1) - data_ci(1,:,1,1));
plot(data_i(end,:,1,1) - data_ci(end,:,1,1));
legend('a', 'b', 'c', 'd');
axis 'tight'
title('Matlab - C++ along edges')


